import React from 'react';

function MyPlayer({ location }) {
  const { state } = location || {}; // Using optional chaining here

  return (
    <div>
      
      <h1>My Bookings Page</h1>
      <ul>
        {state?.clickedButtons.map((button, index) => ( // Using optional chaining here
          <li key={index}>{button}</li>
        ))}
      </ul>
    </div>
  );
}


export default MyPlayer;
